DROP TABLE IF EXISTS `liebao_pay_refund_info`;
CREATE TABLE `liebao_pay_refund_info` (
  `id` varchar(50) NOT NULL COMMENT '主键',
  `pay_info_id` varchar(50) DEFAULT NULL COMMENT '支付信息主表',
  `wechat_pay_info_id` varchar(50) DEFAULT NULL COMMENT '微信支付信息主表',
