  `refund_channel` varchar(50) DEFAULT NULL COMMENT '退款渠道；01银联;02微信;03支付宝',
  `user_id` varchar(50) DEFAULT NULL COMMENT '用户唯一ID',
  `refund_no` varchar(50) DEFAULT NULL COMMENT '退款流水号（成功才有）',
  `out_trade_no` varchar(50) DEFAULT NULL COMMENT '商户订单号',
  `out_refund_no` varchar(50) DEFAULT NULL COMMENT '商户退款单号',
  `total_fee` varchar(50) DEFAULT NULL COMMENT '订单金额',
  `refund_fee` varchar(50) DEFAULT NULL COMMENT '退款金额',
  `refund_desc` varchar(50) DEFAULT NULL COMMENT '退款原因',
  `notify_url` varchar(50) DEFAULT NULL COMMENT '回调URL',
  `refund_status` varchar(50) DEFAULT NULL COMMENT '退款状态；00成功，01失败;02退款关闭;03未知错误;04处理中',
  `refund_start_time` datetime DEFAULT NULL COMMENT '退款开始时间',
  `refund_end_time` datetime DEFAULT NULL COMMENT '退款结束时间',
  `refund_success_time` datetime DEFAULT NULL COMMENT '退款成功时间',
  `refund_recv_accout` varchar(50) DEFAULT NULL COMMENT '退款入账账户；1退回银行卡({银行名称}{卡类型}{卡尾号});2退回支付用户零钱(支付用户零钱);3退还商户(商户基本账户,商户结算银行账户);4退回支付用户零钱通(支付用户零钱通)针对微信',
  `refund_account` varchar(50) DEFAULT NULL COMMENT '退款资金来源;REFUND_SOURCE_RECHARGE_FUNDS可用余额退款/基本账户;REFUND_SOURCE_UNSETTLED_FUNDS 未结算资金退款(针对微信)',
  `refund_request_source` varchar(50) DEFAULT NULL COMMENT 'API接口;VENDOR_PLATFORM商户平台(针对微信)',
  `REMARKS` varchar(255) DEFAULT NULL COMMENT '备注',
  `CREATE_BY` varchar(50) DEFAULT NULL COMMENT '创建人',
  `CREATE_DATE` datetime DEFAULT NULL COMMENT '创建时间',
  `UPDATE_BY` varchar(50) DEFAULT NULL COMMENT '修改人',
  `UPDATE_date` datetime DEFAULT NULL COMMENT '修改时间',
  PRIMARY KEY (`id`)
