DROP TABLE IF EXISTS `liebao_wechat_pay_info`;
CREATE TABLE `liebao_wechat_pay_info` (
  `id` varchar(50) NOT NULL COMMENT '主键',
  `pay_info_id` varchar(50) DEFAULT NULL COMMENT '外键支付信息表主键',
  `order_id` varchar(50) DEFAULT NULL COMMENT '商户订单号',
  `appid` varchar(50) DEFAULT NULL COMMENT '公众账号ID',
  `mch_id` varchar(50) DEFAULT NULL COMMENT '商户号',
  `device_info` varchar(50) DEFAULT NULL COMMENT '设备号',
  `nonce_str` varchar(50) DEFAULT NULL COMMENT '微信随机字符串',
  `body` varchar(50) DEFAULT NULL COMMENT '商品描述',
  `spbill_create_ip` varchar(50) DEFAULT NULL COMMENT '终端IP',
  `total_fee` varchar(50) DEFAULT NULL COMMENT '订单总金额，单位为分',
  `fee_type` varchar(50) DEFAULT NULL COMMENT '标价币种(默认人民币)',
  `cash_fee` varchar(50) DEFAULT NULL COMMENT '现金支付金额',
  `trade_type` varchar(50) DEFAULT NULL COMMENT '微信交易类型 JSAPI 公众号支付',
  `product_id` varchar(50) DEFAULT NULL COMMENT '微信扫码支付，此参数必传',
  `openid` varchar(50) DEFAULT NULL COMMENT 'openid',
  `time_start` datetime DEFAULT NULL COMMENT '交易起始时间',
  `time_expire` datetime DEFAULT NULL COMMENT '交易结束时间',
  `limit_pay` varchar(50) DEFAULT NULL COMMENT '上传此参数no_credit--可限制用户不能使用信用卡支付',
  `return_code` varchar(50) DEFAULT NULL COMMENT '返回状态码SUCCESS/FAIL',
  `return_msg` varchar(50) DEFAULT NULL COMMENT '返回信息',
  `result_code` varchar(50) DEFAULT NULL COMMENT 'SUCCESS/FAIL',
  `err_code` varchar(50) DEFAULT NULL COMMENT '错误代码',
  `err_code_des` varchar(50) DEFAULT NULL COMMENT '错误代码描述',
  `prepay_id` varchar(50) DEFAULT NULL COMMENT '预支付交易会话标识',
  `code_url` varchar(500) DEFAULT NULL COMMENT '二维码链接trade_type为NATIVE时有返回，用于生成二维码，展示给用户进行扫码支付',
  `trade_state` varchar(50) DEFAULT NULL COMMENT '交易状态,SUCCESS—支付成功;REFUND—转入退款;NOTPAY—未支付;CLOSED—已关闭;REVOKED—已撤销（刷卡支付）;USERPAYING--用户支付中;PAYERROR--支付失败(其他原因，如银行返回失败)',
  `bank_type` varchar(50) DEFAULT NULL COMMENT '付款银行',
  `trade_state_desc` varchar(50) DEFAULT NULL COMMENT '交易状态描述',
  `CREATE_BY` varchar(50) DEFAULT NULL COMMENT '创建人',
  `CREATE_DATE` datetime DEFAULT NULL COMMENT '创建时间',
  `UPDATE_BY` varchar(50) DEFAULT NULL COMMENT '修改人',
  `UPDATE_date` datetime DEFAULT NULL COMMENT '修改时间',
  `scene_info` varchar(200) DEFAULT NULL COMMENT '场景信息',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='微信支付订单详情';

