  `SEND_STATE` tinyint(4) DEFAULT NULL COMMENT '短信发送状态（0：成功 1；失败）',
  `STATUS` tinyint(4) NOT NULL DEFAULT '0' COMMENT '状态（0 正常 1 离职 2 请假 3 其他）',
  `CREATE_BY` bigint(20) DEFAULT NULL COMMENT '创建人',
