  `UPDATE_BY` bigint(20) DEFAULT NULL COMMENT '修改人',
  `UPDATE_DATE` datetime DEFAULT NULL COMMENT '修改时间',
  `REMARKS` varchar(1200) DEFAULT NULL COMMENT '备注',
  `IS_DELETE` tinyint(4) NOT NULL DEFAULT '0' COMMENT '删除标识（0 未删除 1 已删除 2 删除审核）',
  PRIMARY KEY (`ID`),
  KEY `idx_sysuser_username` (`USERNAME`) USING BTREE,
  KEY `idx_sysuser_frozen` (`IS_FROZEN`) USING BTREE,
  KEY `idx_sysuser_lock` (`IS_LOCK`) USING BTREE,
