  KEY `idx_sysuer_flag` (`FLAG`) USING BTREE,
  KEY `idx_sysuser_deptid` (`DEPARTMENT_ID`) USING BTREE,
  KEY `idx_sysuser_statid` (`SERVICE_STATION_ID`) USING BTREE,
  KEY `idx_sysser_supid` (`SUPPLIER_ID`) USING BTREE,
  KEY `idx_sysuser_status` (`STATUS`) USING BTREE,
  KEY `idx_sysuser_delete` (`IS_DELETE`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=7567498 DEFAULT CHARSET=utf8 COMMENT='用户表';

