-- ----------------------------
-- View structure for liebao_user_activity_view
-- ----------------------------
DROP VIEW IF EXISTS `liebao_user_activity_view`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`%` SQL SECURITY DEFINER VIEW `liebao_user_activity_view` AS select `lua`.`id` AS `id`,`lua`.`access_system_id` AS `access_system_id`,`lua`.`app_id` AS `app_id`,`lua`.`user_id` AS `user_id`,`lu`.`realname` AS `realname`,`lua`.`vin_no` AS `vin_no`,`lua`.`activity_system_id` AS `activity_system_id`,`lad`.`activity_name` AS `activity_name`,`lua`.`participation_activity_time` AS `participation_activity_time`,`lua`.`remarks` AS `remarks` from (((`liebao_user_activity` `lua` left join `liebao_user` `lu` on((`lua`.`user_id` = `lu`.`id`))) left join `liebao_activity` `la` on((`lua`.`activity_id` = `la`.`id`))) left join `liebao_activity_details` `lad` on((`lad`.`id` = `la`.`activity_details_id`))) ;

-- ----------------------------
-- View structure for liebao_user_card_count_view2
-- ----------------------------
DROP VIEW IF EXISTS `liebao_user_card_count_view2`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`%` SQL SECURITY DEFINER VIEW `liebao_user_card_count_view2` AS select `lucc`.`id` AS `id`,`lucc`.`access_system_id` AS `accessSystemId`,`lucc`.`app_id` AS `appId`,`lucc`.`user_id` AS `userId`,`lucc`.`vin_no` AS `vinNo`,`lucc`.`card_id` AS `cardId`,`lucc`.`number` AS `number`,`lucc`.`creater` AS `creater`,`lucc`.`create_time` AS `createTime`,`lucc`.`modifier` AS `modifier`,`lucc`.`modify_time` AS `modifyTime`,`lucc`.`version` AS `version`,`lucc`.`remarks` AS `remarks`,`lc`.`name` AS `cardName`,`lu`.`realname` AS `userName` from ((`liebao_user_card_count` `lucc` join `liebao_user` `lu`) join `liebao_card` `lc`) where ((`lu`.`id` = `lucc`.`user_id`) and (`lucc`.`card_id` = `lc`.`id`)) ;

-- ----------------------------
-- View structure for liebao_user_card_view
-- ----------------------------
DROP VIEW IF EXISTS `liebao_user_card_view`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`%` SQL SECURITY DEFINER VIEW `liebao_user_card_view` AS select `luc`.`id` AS `id`,`luc`.`access_system_id` AS `access_system_id`,`luc`.`app_id` AS `app_id`,`luc`.`user_id` AS `user_id`,`luc`.`dealer_id` AS `dealer_id`,`lu`.`realname` AS `realname`,`luc`.`vin_no` AS `vin_no`,`luc`.`card_id` AS `card_id`,`lc`.`name` AS `name`,`luc`.`card_no` AS `card_no`,`luc`.`state` AS `state`,`luc`.`create_time` AS `create_time`,`luc`.`modify_time` AS `modify_time`,`luc`.`remarks` AS `remarks` from ((`liebao_user_card` `luc` join `liebao_user` `lu`) join `liebao_card` `lc`) where ((`luc`.`user_id` = `lu`.`id`) and (`luc`.`card_id` = `lc`.`id`)) ;

-- ----------------------------
-- View structure for liebao_user_experience_count_view
-- ----------------------------
DROP VIEW IF EXISTS `liebao_user_experience_count_view`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`%` SQL SECURITY DEFINER VIEW `liebao_user_experience_count_view` AS select `luec`.`id` AS `id`,`luec`.`access_system_id` AS `access_system_id`,`las`.`name` AS `name`,`luec`.`app_id` AS `app_id`,`luec`.`user_id` AS `user_id`,`lu`.`realname` AS `realname`,`luec`.`vin_no` AS `vin_no`,`li`.`integral` AS `integral`,`luec`.`number` AS `number`,`luec`.`creater` AS `creater`,`luec`.`create_time` AS `create_time`,`luec`.`modifier` AS `modifier`,`luec`.`modify_time` AS `modify_time`,`luec`.`version` AS `version`,`luec`.`remarks` AS `remarks` from ((((`liebao_user_experience_count` `luec` left join `liebao_user` `lu` on((`luec`.`user_id` = `lu`.`id`))) left join `liebao_user_integral_count` `luic` on((`lu`.`integral_count_id` = `luic`.`id`))) left join `liebao_integral` `li` on((`luic`.`integral_id` = `li`.`id`))) left join `liebao_access_system` `las` on((`luec`.`access_system_id` = `las`.`id`))) ;

-- ----------------------------
-- View structure for liebao_user_experience_view
